import React, {Component} from 'react';
import '../static/css/Navbar.css';

class Navbar extends Component {

  render(){
    return(
        <header>
          <ul className='navBar'>
            <li href="#home">Home</li>
            <li href="#about">About me</li>
            <li href="#contact">Contact</li>
          </ul>
        </header>
    );
  }
}

export default Navbar;
